import logo from './logo.svg';
import './App.css';
import {useEffect, useState} from "react";
import Axios from "axios";


function App() {
    const [message, setMessage] = useState("");
    useEffect(()=> {
        fetch("/home")
            .then((res)=>{
                console.log("Hello")
                console.log(res);
                console.log(res.data);
                setMessage(res.data);
            })
            .catch(e => {
                alert("error")
            })
    },[]);


    return (
        <div className="App">
            {message}
        </div>
    );
}

export default App;
